import "./topbar.css"

export default function TopBar() {
  return (
    <div className='top'>
      <div className="topLeft">l
      <i class="fa solid fa-facebook"></i>
      <i class="fa solid fa-twitter"></i>
      <i class="fa solid fa-twitter"></i></div> 
      <div className="topCenter">c</div> 
      <div className="topRight">r</div> 
    </div>
  )
}
